import Home from './components/Home'
import Product from './components/Product';

function App() {
  return (
    <div className='App'>
      <Routes>
        <Route path='/' element={<Home/>}/>
        <Route path='about' element={<Product/>}/>
        <Route path='team' element={<TheTeam/>}/>
